import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Profile() {
  const [doctor, setDoctor] = useState(null);
  const [loading, setLoading] = useState(true);
  const [msg, setMsg] = useState('');
  const [formData, setFormData] = useState({});

  const token = localStorage.getItem('token'); // JWT stored after login

  // Fetch logged-in doctor profile
  const fetchDoctor = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/doctors/me', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setDoctor(res.data);
      setFormData(res.data); // prefill form
      setLoading(false);
    } catch (err) {
      setMsg(err.response?.data?.message || 'Failed to load profile');
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchDoctor();
  }, []);

  const handleChange = (e) => {
    setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.put(
        'http://localhost:5000/api/doctors/me',
        formData,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setDoctor(res.data.doctor);
      setMsg('Profile updated successfully!');
    } catch (err) {
      setMsg(err.response?.data?.error || 'Update failed');
    }
  };

  if (loading) return <p>Loading...</p>;

  return (
    <div>
      <h1>My Profile</h1>
      {msg && <p>{msg}</p>}
      {doctor && (
        <form onSubmit={handleSubmit}>
          <div>
            <label>Name:</label>
            <input name="name" value={formData.name || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Specialization:</label>
            <input name="specialization" value={formData.specialization || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Experience (years):</label>
            <input name="experience" type="number" value={formData.experience || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Availability (comma-separated):</label>
            <input name="availability" value={formData.availability?.join(', ') || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Patients Served:</label>
            <input name="patientsServed" type="number" value={formData.patientsServed || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Rating:</label>
            <input name="rating" type="number" step="0.1" value={formData.rating || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Location:</label>
            <input name="location" value={formData.location || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Contact:</label>
            <input name="contact" value={formData.contact || ''} onChange={handleChange} />
          </div>
          <div>
            <label>Image URL:</label>
            <input name="image" value={formData.image || ''} onChange={handleChange} />
          </div>
          <button type="submit">Update Profile</button>
        </form>
      )}
    </div>
  );
}
